import { FormControl, FormLabel, Input } from "@chakra-ui/react";
import React from "react";

const SignUp = () => {
  return (
    <VStack spacing={4} color="black">
      <FormControl id="first-name" isRequired>
        <FormLabel>Name</FormLabel>
        <Input />
      </FormControl>
    </VStack>
  );
};

export default SignUp;
